function getData(){
    var flight_schedule
    $.ajax({
        type: "GET",
        async: false,
        url: "/get_data",
        data: {},
        success: function(response){
           flight_schedule = response;
        },
        error : function(request, status, error ) {
            console.log("code:"+request.status+"\n"+"message:"+request.responseText+"\n"+"error:"+error);
        },
        complete : function () {
        }
      })
    return flight_schedule;
}

