function setData(cd){

    var defaultData = '<tr><td colspan="9">조회중입니다.</td></tr>';
    $("#result").html(defaultData);

    var json = getData();
    obj = $.parseJSON(json);
//    var obj = getData2();
    var flight = obj.response.body.items;
    var tbodyData;
    var flightCount=0;
    for(var i=0 ; i < flight.length; i++){
        var remark = flight[i].remark;
        var scheduleDateTime = new Date();
        var estimatedDateTime = new Date();
        var now = new Date();
        scheduleDateTime.setHours(flight[i].scheduleDateTime.substring(0,2));
        scheduleDateTime.setMinutes(flight[i].scheduleDateTime.substring(2,4));
        estimatedDateTime.setHours(flight[i].estimatedDateTime.substring(0,2));
        estimatedDateTime.setMinutes(flight[i].estimatedDateTime.substring(2,4));
        var delayTime = ((estimatedDateTime/60000 - scheduleDateTime/60000));
        if(remark == '출발' && delayTime > 120){
            remark = '지연 출발';
        }else if(remark == null){
            remark = '-';
        }


        if(cd == 'all' || cd == null || cd == ''){
            flightCount++;
            tbodyData += '<tr>'+
            '<td>'+(i+1)+'</td>'+
            '<td>'+flight[i].airline+'</td>'+
            '<td>'+flight[i].flightId+'</td>'+
            '<td>'+flight[i].airport+'</td>'+
            '<td>'+formatAMPM(scheduleDateTime)+'</td>'+
            '<td>'+formatAMPM(estimatedDateTime)+'</td>'+
            '<td>'+delayTime+'분</td>'+
            '<td>'+remark+'</td>'+
            '<td><a href="/contract" id="" class="btn_sub1">조회</a></td>'+
            '</tr>';
        }else if(cd=='delayOnBoard'){
            if(remark == '지연 출발' || delayTime > 120){
                flightCount++;
                tbodyData += '<tr>'+
                '<td>'+(i+1)+'</td>'+
                '<td>'+flight[i].airline+'</td>'+
                '<td>'+flight[i].flightId+'</td>'+
                '<td>'+flight[i].airport+'</td>'+
                '<td>'+formatAMPM(scheduleDateTime)+'</td>'+
                '<td>'+formatAMPM(estimatedDateTime)+'</td>'+
                '<td>'+delayTime+'분</td>'+
                '<td>'+remark+'</td>'+
                '<td><a href="/contract" id="" class="btn_sub1">조회</a></td>'+
                '</tr>';
            }
        }else if(cd=='delay'){
            if(delayTime > 10){
                flightCount++;
                tbodyData += '<tr>'+
                '<td>'+(i+1)+'</td>'+
                '<td>'+flight[i].airline+'</td>'+
                '<td>'+flight[i].flightId+'</td>'+
                '<td>'+flight[i].airport+'</td>'+
                '<td>'+formatAMPM(scheduleDateTime)+'</td>'+
                '<td>'+formatAMPM(estimatedDateTime)+'</td>'+
                '<td>'+delayTime+'분</td>'+
                '<td>'+remark+'</td>'+
                '<td><a href="/contract" id="" class="btn_sub1">조회</a></td>'+
                '</tr>';
            }
        }else{
            if((estimatedDateTime > now)){
                flightCount++;
                tbodyData += '<tr>'+
                '<td>'+(i+1)+'</td>'+
                '<td>'+flight[i].airline+'</td>'+
                '<td>'+flight[i].flightId+'</td>'+
                '<td>'+flight[i].airport+'</td>'+
                '<td>'+formatAMPM(scheduleDateTime)+'</td>'+
                '<td>'+formatAMPM(estimatedDateTime)+'</td>'+
                '<td>'+delayTime+'분</td>'+
                '<td>'+remark+'</td>'+
                '<td><a href="/contract" id="" class="btn_sub1">조회</a></td>'+
                '</tr>';
            }
        }
    }
    $("#data_count").text(flightCount);
    $("#result").html(tbodyData);
}



function setTimer(count){
    var countdown = setInterval(function(){
    //해당 태그에 아래 내용을 출력
    $("#timer").html(count+"초 후 검색");
        if (count == 0) {
            clearInterval(countdown);
            setData();
            setTimer(600);
            }
        count--;//카운트 감소
    }, 1000);
 }


function formatAMPM(date) {
  var hours = date.getHours();
  var minutes = date.getMinutes();
  var ampm = hours >= 12 ? 'pm' : 'am';
  hours = hours % 12;
  hours = hours ? hours : 12; // the hour '0' should be '12'
  minutes = minutes < 10 ? '0'+minutes : minutes;
  var strTime = hours + ':' + minutes + ' ' + ampm;
  return strTime;
}

function setContractState(obj, cd){
    $(obj).parent().parent().children().removeClass('on');
    $(obj).parent().addClass('on');
    setData(cd);
}

